c \ub300\uccb4\ub420\uc218\uc788\uc2b5\ub2c8\ub2e4 \uc774 \uc2a4\ud310 \uc575\ud074\ubd80\uce20\ub97c \uc81c\uc791\ud558\uae30\uae4c\uc9c0 \uc5bc\ub9c8\ub098 \uc218\ub9ce\uc740 \uc575\ud074\uc744 \uc2e0\uc5b4\ubcf4\uace0 \ub9cc\uc838\ubd24\ub294\uc9c0 \ubab0\ub77c\uc694. \uc2e0\uc740\ub4ef \uc2e0\uc9c0\uc54a\uc740\ub4ef \uac00\ubccd\uace0 \ubc1c\ud3b8\ud55c \uc0ad\uc2a4\ubd80\uce20\ub97c \ub9cc\ub4e4\uac83, \uc800\ucc98\ub7fc \ubb34\uc9c0\uc678\ubc18\uc99d, \ubc1c\ubcfc\uc774 \ub113\uc740 \ubc1c\uc744 \uc798 \uc7a1\uc544\uc904\uac83. 44-77\uc0ac\uc774\uc988\ub97c \uc785\ub294 \ubaa8\ub4e0\ubd84\ub4e4\uc774 \ucc29\ud654\ud588\uc744\ub54c \ud54f\uc774 \uc608\uc058\uba74\uc11c \ucc29\ud654\uac10\uc774 \ud3b8\ud574\uc57c\ud560\uac83. 150-170cm \ubaa8\ub4e0 \ud0a4\uc5d0 \ucc30\ub5a1\uac19\uc774 \uc5b4\uc6b8\ub9ac\ub294 \uae30\uc7a5\uac10. \uc0d8\ud50c\ub9c1\ub9cc \uc218\ucc28\ub840, \uc800\ubfd0 \uc544\ub2c8\ub77c \uc9c0\uc778\ubd80\ud130 \uc9c1\uc6d0\ub4e4\uae4c\uc9c0. \ubaa8\ub450 \ub108\ubb34 \ud3b8\ud558\ub2e4\ub780 \uc18c\ub9ac\uac00 \ub098\uc62c \ub54c\uae4c\uc9c0 \uba87 \ubc88\uc774\uace0 \ub77c\uc2a4\ud2b8\ub97c \uc218\uc815\ud558\uace0 \ub610 \uc218\uc815\ud588\uc2b5\ub2c8\ub2e4. \ub514\ud14c\uc77c\ud55c \uc791\uc740 \ubd80\ubd84\uae4c\uc9c0 \ud558\ub098\ud558\ub098 \uace0\uc9d1 \uc788\uace0 \uc12c\uc138\ud558\uac8c \uc7a1\uc544\uac00\uba70 \uc81c\ub300\ub85c \ub41c \uc575\ud074 \uc0ad\uc2a4 \ubd80\uce20\ub97c \ub9cc\ub4e4\uc5c8\uc5b4\uc694. \uc2dc\uc911\uc5d0 \"\ucc9c\uc5f0\uac00\uc8fd \uc2a4\uc6e8\uc774\ub4dc\"\ub77c\uace0 \ud310\ub9e4\ub418\ub294 \"\uc218\uc785 \uc778\uc870 \uc2a4\uc6e8\uc774\ub4dc\"\uac00 \uc788\uc5b4\uc694. \uc804\ubb38\uac00\uac00 \ubd10\ub3c4 \ud004\ub9ac\ud2f0\ub098 \uc2e0\ucd95\uc131, \ub0b4\uad6c\uc131\uc774 \ucc9c\uc5f0\uac00\uc8fd\uacfc \uad6c\ubd84\uc774 \uac70\uc758 \ubd88\uac00\ub2a5\ud558\ub2e4\uace0 \ud574\uc694. \ube0c\ub79c\ub4dc \uacf5\uc7a5\uc5d0\uc11c \ub9ce\uc774 \uac00\uc838\uac00\ub294\ub370, \uadf8\ub9cc\ud07c \ub2e8\ua