40 \ud6c4\uae30\ub85c \uc785\uc99d\ub41c \ub9cc\ud07c! \uc790\uc2e0\uc788\uac8c \ucd94\ucc9c\ud574\ub4dc\ub9bd\ub2c8\ub2e4. \uc18c\uc7ac : \uc18c\uac00\uc8fd \uc0ac\uc774\uc988 : \uac00\ub85c 10.5cm * \uc138\ub85c 7.5cm \uc0dd\uc0b0\uc9c0 : \uad6d\ub0b4 \uc0dd\uc0b0 \uc81c\uc870\uc790 : \uc058\ub760\uc81c\uc778 \ud611\ub825\uc5c5\uccb4 \uc81c\uc791 \ucd5c\ub300\ud55c \uae54\ub054\ud55c \uc81c\ud488\uc73c\ub85c \uc120\ubcc4\ud574\uc11c \ubcf4\ub0b4\ub4dc\ub9ac\uc624\ub098 \ucc9c\uc5f0 \uac00\uc8fd\uc758 \ud2b9\uc131\uc0c1 \uc2a4\ud06c\ub808\uce58,\ubbf8\uc138\ud55c \ucc0d\ud798,\ubaa8\uacf5,\uc8fc\ub984\uc774 \uac00\uc8fd \ud45c\uba74\uc5d0 \ud45c\ud604\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ub300\ub7c9 \uc8fc\ubb38,\ub2e8\uccb4 \uc8fc\ubb38, \ub85c\uace0 \uc81c\uc791 \ubaa8\ub450 \uac00\ub2a5\ud569\ub2c8\ub2e4. \ubd80\ub2f4\uc5c6\uc774 \uc804\ud654\uc8fc\uc138\uc694^^ \u25c6 \uc81c\ud488 \uc18c\uc7ac \u25c6 \uce74\ub4dc\uc9c0\uac11\uc740 \ucc9c\uc5f0 \uc18c\uac00\uc8fd\uc73c\ub85c \uc81c\uc791\ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uc77c\uba85 <\ud1a0\uace0 \uac00\uc8fd> \uc785\ub2c8\ub2e4. \ud1a0\uace0 \uac00\uc8fd\uc774\ub780, \uc544\ud504\ub9ac\uce74 \ud1a0\uace0 \uc9c0\uc5ed\uc5d0\uc11c \uc790\ub780 \uc18c\uac00\uc8fd\uc744 \ub73b\ud569\ub2c8\ub2e4. \ud45c\uba74\uc5d0 \uc790\uc798\ud55c \uc8fc\ub984\uacfc \uacb0\uc774 \ubcf4\uc5ec\uc9c0\uace0, \uc798 \uae01\ud788\uc9c0 \uc54a\ub294 \ud2b9\uc131\uc774 \uc788\uc5b4 \ub0b4\uad6c\uc131\uc774 \uc88b\uc2b5\ub2c8\ub2e4. \uce74\ub4dc\uc9c0\uac11\uc758 \uc544\ub798 \uadc0\ud241\uc774 \ubd80\ubd84\uc740 \ub465\uadfc\ud615,\uc0ac\uac01\ud615 \ub450 \uac00\uc9c0\ub85c \uc81c\uc791\ub429\ub2c8\ub2e4. \uc81c\uc791 \uc2dc\uae30\uc5d0 \ub530\ub77c \ubaa8\uc591\uc774 \ub2e4\ub974\uac8c \uc81c\uc791\ub429\ub2c8\ub2e4. \ubaa8\uc591\uc774 \ub79c\ub364\uc73c\ub85c \uc900\ube44\ub418\ub294 \uc810 \uc591\ud574\ubd80\ud0c1\ub4dc\ub9bd\ub2c8\ub2e4. \u25c6 \ud488\uc9c8 \uac80\uc99d \u25c6 \uc800\ud76c\uac00 \uc800\ub834\ud558\uac8c \ud310\ub9e4\ub97c \ud558\ub2e4\ubcf4\ub2c8 \uc9c4\uc9dc \uac00\uc8fd\uc774 \ub9de\ub294\uc9c0, \uc548\uc804\ud55c \uac00\uc8fd\uc778\uc9c0 \uad81\uae08\ud558\uc2e4 \uc218 \uc788\uc744 \uac83 \uac19\uc544\uc11c \uc900\ube44\ud55c \uc2dc\ud5d8 \uc131\uc801\uc11c \uc785\ub2c8\ub2e4. \ucc9c\uc5f0 \uc18c\uac00\uc8fd\uc73c\ub85c \ud2bc\ud2bc\ud558\uac8c \uc81c\uc791\ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uac01\uc885 \uc57d\ud488 \uac80\uc0ac\ub3c4 \ubaa8\ub450 \ud1b5\uacfc\ud558\uc600\uc2b5\ub2c8\ub2e4. \u25c6 \uc81c\ud488 \uc0ac\uc774\uc988 \u25c6 \uce74\ub4dc \ud06c\uae30\ubcf4\ub2e4 \uc870\uae08 \ub354 \ud07d\ub2c8\ub2e4. \uce74\ub4dc\ub97c \ub123\uc73c\uba74 \uc591 \uc606\uc73c\ub85c \uc5ec\uc720 \uacf5\uac04\uc774 \uc0dd\uae41\ub2c8\ub2e4. \uac00\ub85c 10.5cm * \uc138\ub85c 7.5cm \uac00\ub7c9 \ud06c\uae30 \uc785\ub2c8\ub2e4. \ubcf4\ud1b5 \uccb4\uaca9\uc758 \uc131\uc778 \uc5ec\uc131\uc774 \uc190\uc5d0 \uc950\uc5c8\uc744 \ub54c \ubaa8\uc2b5 \uc785\ub2c8\ub2e4. \ud55c \uc190\uc5d0 \uac00\ubccd\uac8c \ub4e4\uae30 \uc88b\uc740 \uc791\uc740 \uc0ac\uc774\uc988 \uc785\ub2c8\ub2e4. \uc81c\uac00 \ub9e4\uc77c \uc0ac\uc6a9\ud558\ub294 \uc81c\ud488\uc774\ub77c \ubc18\ub4e4\ubc18\ub4e4 \uc724\uc774 \ub0a9\ub2c8\ub2e4. \uc791\ub144 \uc5ec\ub984\uc5d0 3\ub144\uc9f8 \uc0ac\uc6a9\ud55c \ubaa8\uc2b5\uc774\ub77c\uba70 \ucd2c\uc601\ud588\ub294\ub370\uc694. \uc2dc\uac04\uc774 \ud758\ub7ec 4\ub144\uc9f8 \ud2bc\ud2bc\ud558\uac8c \uc0ac\uc6a9 \uc911\uc785\ub2c8\ub2e4. \ucc38\uace0\ub85c \uc81c\uac00 \uc4f0\ub294 \uc800 \uc81c\ud488\uc740 \ubd88\ub7c9 \uc81c\ud488\uc778\ub370\uc694. \uc544\uc9c1\uae4c\uc9c0 \ud0c8 \uc5c6\uc774 \uc815\ub9d0 \uc798 \uc4f0\uace0 \uc788\uc5b4\uc694 :-) \u25c6 \uc81c\ud488 \ub514\ud14c\uc77c \u25c6 \uce74\ub4dc \uc55e,\ub4a4 \uc591\uba74 \uc218\ub0a9\uc774 \uac00\ub2a5\ud569\ub2c8\ub2e4. \uc55e 2\uce78, \ub4a4 2\uce78\uacfc \uac00\uc6b4\ub370 \uc9c0\ud3d0,\uc601\uc218\uc99d\uc744 \ub123\uc744 \uc218 \uc788\ub294 \uacf5\uac04\uc774 \uc788\uc2b5\ub2c8\ub2e4. \uac00\uc7a5\uc790\ub9ac